contract UniswapV2Router01 is IUniswapV2Router01 {
    //weth
    address public factory;
    address public WETH;
    //:
    modifier ensure(uint256 deadline) {
        // solium-disable-next-line security/no-block-members
        require(deadline >= block.timestamp, "UniswapV2Router: EXPIRED");
        _;
    }

    //:weth
    constructor(address _factory, address _WETH) public {
        factory = _factory;
        WETH = _WETH;
    }

    //
    function() external payable {
        //weth
        assert(msg.sender == WETH);
        // only accept ETH via fallback from the WETH contract
    }

    // **** ADD LIQUIDITY ****
    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param amountADesired A
     * @param amountBDesired B
     * @param amountAMin A
     * @param amountBMin B
     * @return amountA   A
     * @return amountB   B
     */
    function _addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin
    ) private returns (uint256 amountA, uint256 amountB) {
        // create the pair if it doesn't exist yet
        //,
        if (IUniswapV2Factory(factory).getPair(tokenA, tokenB) == address(0)) {
            IUniswapV2Factory(factory).createPair(tokenA, tokenB);
        }
        //reserve{A,B}
        (uint256 reserveA, uint256 reserveB) = UniswapV2Library.getReserves(
            factory,
            tokenA,
            tokenB
        );
        //reserve{A,B}==0
        if (reserveA == 0 && reserveB == 0) {
            //amount{A,B} = A,B
            (amountA, amountB) = (amountADesired, amountBDesired);
        } else {
            //B = A * B / A
            uint256 amountBOptimal = UniswapV2Library.quote(
                amountADesired,
                reserveA,
                reserveB
            );
            //B <= B
            if (amountBOptimal <= amountBDesired) {
                //B >= B
                require(
                    amountBOptimal >= amountBMin,
                    "UniswapV2Router: INSUFFICIENT_B_AMOUNT"
                );
                //amount{A,B} = A, B
                (amountA, amountB) = (amountADesired, amountBOptimal);
            } else {
                //A = A * A / B
                uint256 amountAOptimal = UniswapV2Library.quote(
                    amountBDesired,
                    reserveB,
                    reserveA
                );
                //A <= A
                assert(amountAOptimal <= amountADesired);
                //A >= A
                require(
                    amountAOptimal >= amountAMin,
                    "UniswapV2Router: INSUFFICIENT_A_AMOUNT"
                );
                //amount{A,B} = A, B
                (amountA, amountB) = (amountAOptimal, amountBDesired);
            }
        }
    }

    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param amountADesired A
     * @param amountBDesired B
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @return amountA   A
     * @return amountB   B
     * @return liquidity   
     */
    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    )
    external
    ensure(deadline)
    returns (
        uint256 amountA,
        uint256 amountB,
        uint256 liquidity
    )
    {
        //A,B
        (amountA, amountB) = _addLiquidity(
            tokenA,
            tokenB,
            amountADesired,
            amountBDesired,
            amountAMin,
            amountBMin
        );
        //TokenA,TokenB,`pair`
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        //amountAtokenAmsg.senderpair
        TransferHelper.safeTransferFrom(tokenA, msg.sender, pair, amountA);
        //amountBtokenBmsg.senderpair
        TransferHelper.safeTransferFrom(tokenB, msg.sender, pair, amountB);
        // = pairto
        liquidity = IUniswapV2Pair(pair).mint(to);
    }

    /**
     * @dev ETH
     * @param token token
     * @param amountTokenDesired Token
     * @param amountTokenMin Token
     * @param amountETHMin ETH
     * @param to to
     * @param deadline 
     * @return amountToken   Token
     * @return amountETH   ETH
     * @return liquidity   
     */
    function addLiquidityETH(
        address token,
        uint256 amountTokenDesired,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    )
    external
    payable
    ensure(deadline)
    returns (
        uint256 amountToken,
        uint256 amountETH,
        uint256 liquidity
    )
    {
        //Token,ETH
        (amountToken, amountETH) = _addLiquidity(
            token,
            WETH,
            amountTokenDesired,
            msg.value,
            amountTokenMin,
            amountETHMin
        );
        //Token,WETH,`pair`
        address pair = UniswapV2Library.pairFor(factory, token, WETH);
        //`Token`tokenmsg.sender`pair`
        TransferHelper.safeTransferFrom(token, msg.sender, pair, amountToken);
        //`WETH``ETH`
        IWETH(WETH).deposit.value(amountETH)();
        //`ETH``WETH`token`pair`
        assert(IWETH(WETH).transfer(pair, amountETH));
        // = pair`to`
        liquidity = IUniswapV2Pair(pair).mint(to);
        //``>`ETH` ``-`ETH`
        if (msg.value > amountETH)
            TransferHelper.safeTransferETH(msg.sender, msg.value - amountETH);
        // refund dust eth, if any
    }

    // **** REMOVE LIQUIDITY ****
    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param liquidity 
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @return amountA   A
     * @return amountB   B
     */
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    ) public ensure(deadline) returns (uint256 amountA, uint256 amountB) {
        //TokenA,TokenBCREATE2
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        //pair()
        IUniswapV2Pair(pair).transferFrom(msg.sender, pair, liquidity);
        // send liquidity to pair
        //pair,0,1tokento
        (uint256 amount0, uint256 amount1) = IUniswapV2Pair(pair).burn(to);
        //tokenA,tokenB
        (address token0,) = UniswapV2Library.sortTokens(tokenA, tokenB);
        //tokenAB
        (amountA, amountB) = tokenA == token0
        ? (amount0, amount1)
        : (amount1, amount0);
        //ABAB
        require(
            amountA >= amountAMin,
            "UniswapV2Router: INSUFFICIENT_A_AMOUNT"
        );
        require(
            amountB >= amountBMin,
            "UniswapV2Router: INSUFFICIENT_B_AMOUNT"
        );
    }

    /**
     * @dev ETH
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountETHMin ETH
     * @param to to
     * @param deadline 
     * @return amountToken   token
     * @return amountETH   ETH
     */
    function removeLiquidityETH(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline
    ) public ensure(deadline) returns (uint256 amountToken, uint256 amountETH) {
        //(token,ETH) = (token,WETH,,token,ETH,,)
        (amountToken, amountETH) = removeLiquidity(
            token,
            WETH,
            liquidity,
            amountTokenMin,
            amountETHMin,
            address(this),
            deadline
        );
        //tokentokento
        TransferHelper.safeTransfer(token, to, amountToken);
        //WETHETH
        IWETH(WETH).withdraw(amountETH);
        //ETHETHto
        TransferHelper.safeTransferETH(to, amountETH);
    }

    /**
     * @dev 
     * @param tokenA tokenA
     * @param tokenB tokenB
     * @param liquidity 
     * @param amountAMin A
     * @param amountBMin B
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountA   A
     * @return amountB   B
     */
    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint256 liquidity,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountA, uint256 amountB) {
        //TokenA,TokenBCREATE2
        address pair = UniswapV2Library.pairFor(factory, tokenA, tokenB);
        //,valueuint256,
        uint256 value = approveMax ? uint256(- 1) : liquidity;
        //pair(,,,,v,r,s)
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        //(A,B) = (tokenA,tokenB,,A,B,to,)
        (amountA, amountB) = removeLiquidity(
            tokenA,
            tokenB,
            liquidity,
            amountAMin,
            amountBMin,
            to,
            deadline
        );
    }

    /**
     * @dev ETH
     * @param token token
     * @param liquidity 
     * @param amountTokenMin token
     * @param amountETHMin ETH
     * @param to to
     * @param deadline 
     * @param approveMax 
     * @param v v
     * @param r r
     * @param s s
     * @return amountToken   token
     * @return amountETH   ETH
     */
    function removeLiquidityETHWithPermit(
        address token,
        uint256 liquidity,
        uint256 amountTokenMin,
        uint256 amountETHMin,
        address to,
        uint256 deadline,
        bool approveMax,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external returns (uint256 amountToken, uint256 amountETH) {
        //Token,WETHCREATE2
        address pair = UniswapV2Library.pairFor(factory, token, WETH);
        //,valueuint256,
        uint256 value = approveMax ? uint256(- 1) : liquidity;
        //pair(,,,,v,r,s)
        IUniswapV2Pair(pair).permit(
            msg.sender,
            address(this),
            value,
            deadline,
            v,
            r,
            s
        );
        //(token,ETH) = ETH(token,,token,ETH,to,)
        (amountToken, amountETH) = removeLiquidityETH(
            token,
            liquidity,
            amountTokenMin,
            amountETHMin,
            to,
            deadline
        );
    }

    // **** SWAP ****
    /**
     * @dev 
     * @notice 
     * @param amounts 
     * @param path 
     * @param _to to
     */
    // requires the initial amount to have already been sent to the first pair
    function _swap(
        uint256[] memory amounts,
        address[] memory path,
        address _to
    ) private {
        //
        for (uint256 i; i < path.length - 1; i++) {
            //(,) = (,)
            (address input, address output) = (path[i], path[i + 1]);
            //token0 = (,)
            (address token0,) = UniswapV2Library.sortTokens(input, output);
            // = 
            uint256 amountOut = amounts[i + 1];
            //(0,1) = ==token0 ? (0,) : (,0)
            (uint256 amount0Out, uint256 amount1Out) = input == token0
            ? (uint256(0), amountOut)
            : (amountOut, uint256(0));
            //to = i<-2 ? (,)pair : to
            address to = i < path.length - 2
            ? UniswapV2Library.pairFor(factory, output, path[i + 2])
            : _to;
            //(,)pair(0,1,to,0x00)
            IUniswapV2Pair(UniswapV2Library.pairFor(factory, input, output))
            .swap(amount0Out, amount1Out, to, new bytes(0));
        }
    }

    /**
     * @dev ETHtoken
     * @param amountOutMin 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapExactETHForTokens(
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable ensure(deadline) returns (uint256[] memory amounts) {
        //WETH
        require(path[0] == WETH, "UniswapV2Router: INVALID_PATH");
        //  ((msg.value * 997 * Out) / (In * 1000 + msg.value * 997))
        amounts = UniswapV2Library.getAmountsOut(factory, msg.value, path);
        //>=
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        //[0]ETHWETH
        IWETH(WETH).deposit.value(amounts[0])();
        //[0]WETH(0,1)pair
        assert(
            IWETH(WETH).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amounts[0]
            )
        );
        //(,,to)
        _swap(amounts, path, to);
    }

    /**
     * @dev tokenETH
     * @param amountOut 
     * @param amountInMax 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapTokensForExactETH(
        uint256 amountOut,
        uint256 amountInMax,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) returns (uint256[] memory amounts) {
        //WETH
        require(path[path.length - 1] == WETH, "UniswapV2Router: INVALID_PATH");
        //  ((In * Out * 1000) / (Out -  * 997) + 1)
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        //<=
        require(
            amounts[0] <= amountInMax,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        //(,,)
        _swap(amounts, path, address(this));
        //WETHETH
        IWETH(WETH).withdraw(amounts[amounts.length - 1]);
        //ETHto
        TransferHelper.safeTransferETH(to, amounts[amounts.length - 1]);
    }

    /**
     * @dev tokenETH
     * @param amountIn 
     * @param amountOutMin hard code
     * @param path token ether 
     * @param to to 
     * @param deadline 
     * @return amounts[]  
     */
    function swapExactTokensForETH(
        uint256 amountIn,
        uint256 amountOutMin,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external ensure(deadline) returns (uint256[] memory amounts) {
        //WETH
        require(path[path.length - 1] == WETH, "UniswapV2Router: INVALID_PATH");
        //  (( * 997 * Out) / (In * 1000 +  * 997))
        amounts = UniswapV2Library.getAmountsOut(factory, amountIn, path);
        //>=
        require(
            amounts[amounts.length - 1] >= amountOutMin,
            "UniswapV2Router: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        //[0][0]token0,1pair
        TransferHelper.safeTransferFrom(
            path[0],
            msg.sender,
            UniswapV2Library.pairFor(factory, path[0], path[1]),
            amounts[0]
        );
        //(,,)
        _swap(amounts, path, address(this));
        //WETHETH
        IWETH(WETH).withdraw(amounts[amounts.length - 1]);
        //ETHto
        TransferHelper.safeTransferETH(to, amounts[amounts.length - 1]);
    }

    /**
     * @dev ETHtoken
     * @param amountOut 
     * @param path 
     * @param to to
     * @param deadline 
     * @return amounts[]  
     */
    function swapETHForExactTokens(
        uint256 amountOut,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable ensure(deadline) returns (uint256[] memory amounts) {
        //WETH
        require(path[0] == WETH, "UniswapV2Router: INVALID_PATH");
        //  ((In * Out * 1000) / (Out -  * 997) + 1)
        amounts = UniswapV2Library.getAmountsIn(factory, amountOut, path);
        //<=msg.value
        require(
            amounts[0] <= msg.value,
            "UniswapV2Router: EXCESSIVE_INPUT_AMOUNT"
        );
        //[0]ETHWETH
        IWETH(WETH).deposit.value(amounts[0])();
        //[0]WETH(0,1)pair
        assert(
            IWETH(WETH).transfer(
                UniswapV2Library.pairFor(factory, path[0], path[1]),
                amounts[0]
            )
        );
        //(,,to)
        _swap(amounts, path, to);
        //``>`[0]` ``-`[0]`
        if (msg.value > amounts[0])
            TransferHelper.safeTransferETH(msg.sender, msg.value - amounts[0]);
        // refund dust eth, if any
    }

    function quote(
        uint256 amountA,
        uint256 reserveA,
        uint256 reserveB
    ) public pure returns (uint256 amountB) {
        return UniswapV2Library.quote(amountA, reserveA, reserveB);
    }

    // **** LIBRARY FUNCTIONS ****
    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut
    ) public pure returns (uint256 amountOut) {
        return UniswapV2Library.getAmountOut(amountIn, reserveIn, reserveOut);
    }

    function getAmountIn(
        uint256 amountOut,
        uint256 reserveIn,
        uint256 reserveOut
    ) public pure returns (uint256 amountIn) {
        return UniswapV2Library.getAmountOut(amountOut, reserveIn, reserveOut);
    }

    function getAmountsOut(uint256 amountIn, address[] memory path)
    public
    view
    returns (uint256[] memory amounts)
    {
        return UniswapV2Library.getAmountsOut(factory, amountIn, path);
    }

    function getAmountsIn(uint256 amountOut, address[] memory path)
    public
    view
    returns (uint256[] memory amounts)
    {
        return UniswapV2Library.getAmountsIn(factory, amountOut, path);
    }
}

